Looking at the examples, I can identify the following pattern:

1. There's a separator color that forms lines dividing the grid into regions
2. Each region has marker colors at diagonal positions from its corners
3. The regions are filled with concentric rectangles using those marker colors

For each region:
- Find markers along the diagonal from each corner
- If the corner is the background color, it becomes the first layer color
- Fill cells based on their distance from the edges (layer), cycling through the marker colors

