def solver(input_grid):
    import numpy as np
    from collections import Counter

    grid = np.array(input_grid)
    rows, cols = grid.shape
    output = grid.copy()

    background = Counter(grid.flatten()).most_common(1)[0][0]

    separator_color = None
    max_score = 0

    for color in set(grid.flatten()) - {background}:
        positions = list(zip(*np.where(grid == color)))
        if len(positions) < 3:
            continue
        col_counts = Counter(p[1] for p in positions)
        row_counts = Counter(p[0] for p in positions)
        score = max(max(col_counts.values(), default=0), max(row_counts.values(), default=0))
        if score > max_score:
            max_score = score
            separator_color = color

    if separator_color is None or max_score < 3:
        return output.tolist()

    visited = np.zeros_like(grid, dtype=bool)
    regions = []

    for r in range(rows):
        for c in range(cols):
            if not visited[r, c] and grid[r, c] != separator_color:
                region_cells = []
                queue = [(r, c)]
                visited[r, c] = True
                while queue:
                    cr, cc = queue.pop(0)
                    region_cells.append((cr, cc))
                    for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                        nr, nc = cr + dr, cc + dc
                        if 0 <= nr < rows and 0 <= nc < cols and not visited[nr, nc] and grid[nr, nc] != separator_color:
                            visited[nr, nc] = True
                            queue.append((nr, nc))
                if region_cells:
                    regions.append(region_cells)

    regions.sort(key=len, reverse=True)

    for region_cells in regions:
        min_r, max_r = min(c[0] for c in region_cells), max(c[0] for c in region_cells)
        min_c, max_c = min(c[1] for c in region_cells), max(c[1] for c in region_cells)
        max_diag = min(max_r - min_r + 1, max_c - min_c + 1)
        region_set = set(region_cells)

        best_markers = []
        for corner_type in range(4):
            markers, corner_is_bg = [], False
            for d in range(max_diag):
                if corner_type == 0: r, c = min_r + d, min_c + d
                elif corner_type == 1: r, c = min_r + d, max_c - d
                elif corner_type == 2: r, c = max_r - d, min_c + d
                else: r, c = max_r - d, max_c - d

                if (r, c) not in region_set:
                    continue
                val = grid[r, c]
                if d == 0:
                    corner_is_bg = (val == background)
                if val != background and val != separator_color:
                    markers.append(val)

            if corner_is_bg and markers:
                markers = [background] + markers
            if len(markers) > len(best_markers):
                best_markers = markers

        if not best_markers:
            continue

        for cr, cc in region_cells:
            layer = min(cr - min_r, max_r - cr, cc - min_c, max_c - cc)
            output[cr, cc] = best_markers[layer % len(best_markers)]

    return output.tolist()
